--
-- Name: v_endereco; Type: VIEW; Schema: cadastro; Owner: ieducar
--

CREATE VIEW v_endereco AS
 SELECT e.idpes,
    e.cep,
    e.idlog,
    e.numero,
    e.letra,
    e.complemento,
    e.idbai,
    e.bloco,
    e.andar,
    e.apartamento,
    l.nome AS logradouro,
    l.idtlog,
    b.nome AS bairro,
    m.nome AS cidade,
    m.sigla_uf,
    b.zona_localizacao
   FROM endereco_pessoa e,
    public.logradouro l,
    public.bairro b,
    public.municipio m
  WHERE ((((e.idlog = l.idlog) AND (e.idbai = b.idbai)) AND (b.idmun = m.idmun)) AND (e.tipo = (1)::numeric))
UNION
 SELECT e.idpes,
    e.cep,
    NULL::numeric AS idlog,
    e.numero,
    e.letra,
    e.complemento,
    NULL::numeric AS idbai,
    e.bloco,
